import React from 'react';
import Sdata from './Sdata'
import Card from './Card';

const Netflix=()=>{
    return(
        <Card key={Sdata[1].id} 
imgsrc={Sdata[1].imgsrc} 
text={Sdata[1].text}
 title={Sdata[1].title}
  link={Sdata[1].link}/>
    );
}
export default Netflix;
